import React from 'react'
import { useState, useEffect } from 'react'
import './FolderCreating.css'

function FolderCreating() {
  const [foldername, setFoldername] = useState('New Folder');
  return (
    <div className='Folder-Header'  onClick={onselect} onDoubleClick={ondouble}>
        <div className='LHS'>
            <div className='Folder-Header-Icon'></div>
            <p className='Folder-Header-Name'>{foldername}</p>
        </div>
        <button className='Folder-Header-DropDown' onClick={toggleContents}></button>
    </div>
  )
}

export default FolderCreating
